package com.qhc.sap.entity;import java.io.Serializable;import java.util.Date;/** *  * Function: Data transfer object. <br>  * * @author walker */public class Order		implements Serializable {	private static final long serialVersionUID = 2768857919620841383L;		/* sap存量合同号 */	private String contractNumber = null;	public Order(){	}	public String getContractNumber() {		return this.contractNumber;	}	public void setContractNumber(String contractNumber) {		this.contractNumber = contractNumber;	}	 	@Override	public int hashCode() {		final int prime = 31;		int result = 1;		result = prime * result + ((contractNumber == null) ? 0 : contractNumber.hashCode());		return result;	}	@Override	public boolean equals(Object obj) {		if (this == obj) {			return true;		}		if (obj == null) {			return false;		}		if (getClass() != obj.getClass()) {			return false;		}		final Order other = (Order) obj;		return (this.contractNumber == null ? other.contractNumber == null : this.contractNumber.equals(other.contractNumber));	}		public String toString() {	    final String tab = "  ";	    String str = "";	    str = "Order ( "	        + "contractNumber = " + this.contractNumber + tab	        + " )";		    return str;	}}